import React from "react";
import { useState, useEffect } from "react";

function Listkamarjson() {
  const [products, setproducts] = useState([]);

  useEffect(() => {
    fetchdata();
  }, []);

  const fetchdata = async () => {
    const response = await fetch("http://localhost:8080/kamar");
    const data = await response.json();
    setproducts(data);
  };
  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>id</th>
            <th>kamar</th>
            <th>harga</th>
            <th>action</th>
          </tr>
        </thead>
        <tbody>
            {products.map((product) => (
          <tr>
            <td>{}</td>
            <td>{product.kamar}</td>
            <td>{product.harga}</td>
            <td>
                <a className="button is-small is-info">edit</a>
                <a className="button is-small is-danger">delete</a>
            </td>
          </tr>
           ) )}
        </tbody>
      </table>
    </div>
  );
}

export default Listkamarjson;
